import { BrowserRouter, Routes, Route, Switch } from "react-router-dom";
import { LinksBar, Navbar } from "./components/Navbar";
import { Main } from "./components/Main";
import { About, EngineFix, HodovayaFix, ToAutoFix, ElectricFix, ConditionerFix, ConditionerUsaFix, RozvalFix } from "./components/SimpleLinks";
import {Footer} from "./components/Footer";
import {Blog, BlogNews} from "./components/Blog"

const AppRoutes = ({href, setSingleBlog, singleBlog}) => {
  return (
    <>
    <BrowserRouter>
      <Navbar/>
      <LinksBar href={href}/>
      <Routes>
        <Route exact path="/" element={<Main/>}/>
        <Route exact path="/about" element={<About/>}/>
        <Route exact path="/enginefix" element={<EngineFix/>}/>
        <Route exact path="/hodovaya" element={<HodovayaFix/>}/>
        <Route exact path="/toautofix" element={<ToAutoFix/>}/>
        <Route exact path="/electricfix" element={<ElectricFix/>}/>
        <Route exact path="/conditionerfix" element={<ConditionerFix/>}/>
        <Route exact path="/conditionerusafix" element={<ConditionerUsaFix/>}/>
        <Route exact path="/rozvalfix" element={<RozvalFix/>}/>
        <Route exact path="/blog" element={<Blog setSingleBlog={setSingleBlog}/>}/>
        <Switch>
        <Route exact path="/blog/news/:id" element={<BlogNews singleBlog={singleBlog}/>}/>
        </Switch>
      </Routes>
      <Footer/>
      </BrowserRouter>
    </>
  );
};

export default AppRoutes;
